    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <p>Les tutos League of Leagends sont maintenant disponibles sur Up&Win</p>
        <button type="button" className="Button">
          Go !
        </button>
      </div>
    );
  }
}

export default Home;
